        self.TYPPRICE = bt.talib.TYPPRICE(self.data.high, self.data.low,  self.data.close)\n\n        pass\n\n    def next(self):\n\n        # #AVGPRICE \u751f\u6210\u4ea4\u6613\u4fe1\u53f7\n        # buy_index = (self.short_avg[0] &gt; self.long_avg[0]) &amp; (self.short_avg[-1] &lt;=self.long_avg[-1])\n        # sell_index = (self.short_avg[0] &lt; self.long_avg[0]) &amp; (self.short_avg[-1] &gt;=self.long_avg[-1])\n        # if buy_index:\n        #     # self.buy()\n        #     self.position_percent += 0.2\n        #     self.position_percent = 1 if self.position_percent &gt; 1 else self.position_percent\n        #     self.order = self.order_target_percent(target=self.position_percent)\n        # if sell_index:\n        #     # self.sell()\n        #     self.position_percent -= 0.4\n        #     self.position_percent = 0 if self.position_percent &lt; 0 else self.position_percent\n        #     self.order = self.order_target_percent(target=self.position_percent)\n        pass\n"},"id":"1603","type":"Div"},{"attributes":{"angle":{"units":"deg","value":180},"fill_color":{"value":"#ff0000"},"line_color":{"value":"#ff0000"},"marker":{"value":"triangle"},"size":{"value":8.0},"x":{"field":"index"},"y":{"field":"2060232645456"}},"id":"1309","type":"Scatter"},{"attributes":{},"id":"1546","type":"UnionRenderers"},{"attributes":{"fill_color":{"value":"#0000ff"},"line_color":{"value":"#0000ff"},"size":{"value":8.0},"x":{"field":"index"},"y":{"field":"2060232644496"}},"id":"1117","type":"Circle"},{"attributes":{"angle":{"units":"deg","value":180},"fill_alpha":{"value":0.1},"fill_color":{"value":"#ff0000"},"line_alpha":{"value":0.1},"line_color":{"value":"#ff0000"},"marker":{"value":"triangle"},"size":{"value":8.0},"x":{"field":"index"},"y":{"field":"2060232645456"}},"id":"1310","type":"Scatter"},{"attributes":{"columns":[{"id":"1403"},{"id":"1406"}],"fit_columns":true,"height":31525,"index_position":null,"sizing_mode":"stretch_width","source":{"id":"1401"},"view":{"id":
